import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Navbar from './components/Navbar';
import Home from './components/Home'
import PostDetail from './components/PostDetail'
import './App.css';
import combine from './combine.png';


function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route path="/" exact>
          <h1>Home Page</h1>
        </Route>
        <Route path="/post/:id">
          <h1>Post Details</h1>
        </Route>
      </Switch>
      <header className="App-header">
        <img src={combine} className="App-logo" alt="logo" />
      <p>Greetings, this is my first React Application!</p>
      <p>May thy walk this new path gracefully, learn a lot, make mistakes, and expouse happiness.</p>
    <a
      className="App-links" 
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
      >Learn React
      </a>
    </header> 
    </div>
  );
};

export default App;
